void writeTitle(int version)
{
	for(int i = 0; i < playScreen.height; i++)
	{
		for(int j = 0; j < playScreen.width; j++)
		{
			switch (version)
			{
				case 2:
				if(defaultScreen.image_pixels[(i*defaultScreen.width+j)*4] == 0)
				{
					writeBit(j*SIZE, i*SIZE, 0);
				}
				else
				{
					writeBit(j*SIZE, i*SIZE, 1);
				}
				break;
				case 1:
				if(playScreen.image_pixels[(i*playScreen.width+j)*4] == 0)
				{
					writeBit(j*SIZE, i*SIZE, 0);
				}
				else
				{
					writeBit(j*SIZE, i*SIZE, 1);
				}
				break;
				case 0:
				if(exitScreen.image_pixels[(i*exitScreen.width+j)*4] == 0)
				{
					writeBit(j*SIZE, i*SIZE, 0);
				}
				else
				{
					writeBit(j*SIZE, i*SIZE, 1);
				}
				break;
			}
		}
	}
}
